// import logo from './logo.svg';
import '../index.css';
import './App.js';
import Header from './Header';
import Main from '../Main';
import Footer from './Footer';
import PopupWithForm from './PopupWithForm';

function App() {
  return (
    <div>
      <body className="page">
      <Header />
       <Main />
       <Footer />
       <PopupWithForm id="popupInfo" name='more-info' title='Редактировать профиль' />
       <PopupWithForm id="popupItem" name='formMoreItem' title='Новое место' />
       <PopupWithForm name='delete-card' title='Обновить аватар' />
       <PopupWithForm name='profile-avatar' title='Вы уверены?' />
      </body>
    </div>
  );
}
export default App;
